import React from "react";
import './tablenumber.css'

class TableNumber extends React.Component {
    showmore(id: string) {

        const btn: any = document.getElementById(id)
        if (btn.style.display == 'none')
            btn.style.display = 'flex';

        document.addEventListener("mousedown", (event) => {
            btn.style.display = 'none';
        })

    }

    render() {
        return (
            <div className='div-layout' >
                <div className='row1'>
                    <div className="col-num1"></div>
                    <div className="col-num2"></div>
                    <div className="col-num3"></div>
                    <div className="col-num4"></div>
                    <div className="col-num5"></div>
                    <div className="col-num6"></div>
                    <div className="col-num7"></div>
                    <div className="col-num8"></div>
                </div>
                <div className='row2'></div>
                <div className='row3'></div>
                <div className='row2'></div>
                <div className='row3'></div>
                <div className='row2'></div>
                <div className='row3'></div>
                <div className='row2'></div>
                <div className='row3'></div>
                <div className='row4'></div>

            </div>
        )
    }
}
export default TableNumber;
